import React from 'react'

const MemberTeams = ({ teams }) => {
  return (
    teams.length
      ? <div className="MemberTeams">
          <p>Teams</p>
          <ul>{teams.map ( team =>
            <li key={team.id}>
              {team.name}
            </li>
          )}</ul>
        </div>
      : <h3>...No Teams Yet...</h3>
  )
}

export default MemberTeams
